import {canChange} from './move-pieces-to-obtain-a-string'

test('checks if target string can be obtained 1', () => {
  const start = '_L__R__R_'
  const target = 'L______RR'

  expect(canChange(start, target)).toEqual(true)
})

test('checks if target string can be obtained 2', () => {
  const start = 'R_L_'
  const target = '__LR'

  expect(canChange(start, target)).toEqual(false)
})

test('checks if target string can be obtained 3', () => {
  const start = '_R'
  const target = 'R_'

  expect(canChange(start, target)).toEqual(false)
})

test('checks if target string can be obtained 4', () => {
  const start = '_LL_R__R_'
  const target = 'L__L___RR'

  expect(canChange(start, target)).toEqual(false)
})

test('checks if target string can be obtained 5', () => {
  const start = '_RL_'
  const target = '__LR'

  expect(canChange(start, target)).toEqual(false)
})

test('checks if target string can be obtained 6', () => {
  const start = '_R_'
  const target = '__R'

  expect(canChange(start, target)).toEqual(true)
})

test('checks if target string can be obtained 7', () => {
  const start = '____R__L_'
  const target = 'L___R____'

  expect(canChange(start, target)).toEqual(false)
})

test('checks if target string can be obtained 8', () => {
  const start = '____LLLR_'
  const target = 'L_LL____R'

  expect(canChange(start, target)).toEqual(true)
})

test('checks if target string can be obtained 9', () => {
  const start =
    ''
  const target =
    ''

  expect(canChange(start, target)).toEqual(true)
})

test('checks if target string can be obtained 10', () => {
  const start = '_L__R__R_L'
  const target = 'L______RR_'

  expect(canChange(start, target)).toEqual(false)
})
